import React from 'react';

function MyComponent({ items }) {
  return (
    <div className="container shadow">
	    <div className="row">
	    	<div className="accordion accordion-flush">
	      {items.map((item, index) => (
	        <div className="col-4">
	        	<div>
	          	{item.name}
	          </div>
	        </div>
	      ))}
	      </div>
	    </div>
    </div>
  );
}

export default MyComponent;
